      "description": "A tribute to the finest writers on the game of cricket and an acknowledgement that the great days of cricket literature are behind us. There was a time when major English writers – P. G. Wodehouse, Arthur Conan Doyle, Alec Waugh – took time off to write about cricket, whereas the cricket book market today is dominated by ghosted autobiographies and statistical compendiums. The Picador Book of Cricket celebrates the best writing on the game and includes many pieces that have been out of print, or difficult to get hold of, for years. Including Neville Cardus, C. L. R. James, John Arlott, V. S. Naipaul, and C. B. Fry, this anthology is a must for any cricket follower or anyone interested in sports writing elevated to high art.",
